import React from 'react'
import User from './User'
import './style.css'

class App extends React.Component {
	constructor() {
		super();

		this.state = {
			users: [
        {name: 'Коля', surname: 'Иванов', salary: 100, days: 5},
				{name: 'Вася', surname: 'Петров', salary: 400, days: 10},
				{name: 'Петя', surname: 'Сидоров', salary: 200, days: 7},
      ]
		};
	}

  render() {
   const table = this.state.users.map((item, index) => {
      return( <tr>
              <td>{item.name}</td>
              <td>{item.surname}</td>
              <td>{item.salary}</td>
              <td>{item.days}</td>
             </tr>
      )
   })

		return <table>
			{table}
		</table>;
	}
}

export default App;
